import React, { Component } from 'react'
// import LandlordCard from '../../components/landlord/LandlordCard'
import { connect } from 'react-redux'
import { fetchlandlordhouses } from '../../actions/landlords'

export class LandlordHousesList extends Component {
    constructor() {
        super();

    }

    render() {
        const landlord_id = this.props.landlord_id
        return (
            <div>
                <p>These are the houses for this particular landlord</p>

                <p>{this.props.fetchlandlordhouses(landlord_id)}</p>
            </div>
        )
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchlandlordhouses: landlord_id => dispatch(fetchlandlordhouses(landlord_id))
    }
}

export default connect(null, mapDispatchToProps)(LandlordHousesList)
